import React from 'react'
import { BrowserRouter } from 'react-router-dom'
import LinkRouter from '../components/LinkRouter'
import { Route } from 'react-router';

export default {
  title: 'Link Router',
  component: LinkRouter
}

export function LinkContainer() {

  return (
    <BrowserRouter>
      <div>
        <LinkRouter>
        </LinkRouter>
      </div>
    </BrowserRouter>
  )
}
